import Soccer_Svg from "../static/Soccer_Ball_Background";
import {
  FiMail,
  FiCalendar,
  FiCreditCard,
  FiChevronRight,
  FiChevronDown,
  FiPhone,
} from "react-icons/fi";

const Icon = ({ type }) => {
  switch (type) {
    case "soccer":
      return (
        <Soccer_Svg
          style={{ height: "10px", width: "10px", opacity: 1 }}
          color={"black"}
        />
      );
      break;
    case "mail":
      return FiMail;
      break;
    case "card":
      return FiCreditCard;
      break;
    case "calendar":
      return FiCalendar;
      break;
    case "arrow_right":
      return FiChevronRight;
      break;
    case "arrow_down":
      return FiChevronDown;
      break;
    case "phone":
      return FiPhone;
      break;
  }
};
export default Icon;
